import React from 'react';
import './card-list.style.css'
export const CardList = (props) => {
    console.log(props);
    return <div className='card-list'>
                    {
            props.monsters.map(eachmonster => (
            <h1 key={eachmonster.id}> { eachmonster.name } </h1>
            ))
        }
    </div>;
}
